import React from "react";

const Skills = () => {
  return (
    <div className="skills container-fluid align-content-center ">
      <div className="col-md-6 container techniclal">
        <div className="row">
          <h3>Technical skills</h3>
        </div>
      </div>
      <div className="col-md-6 container soft">
        <div className="row">
          <h3>soft skills</h3>
        </div>
      </div>
    </div>
  );
};
export default Skills;
